            # Defend against the most frequent attacker
            if sorted_attackers:
                top_attacker = sorted_attackers[0]
                execution_engine.attack(me, execution_engine.current_members[top_attacker])
            else:
                # Gather resources if no attackers
                execution_engine.bear(me, me)
    elif total_attacks > 80:
        if sorted_attackers:
            # Attack the top attacker to reduce threat
            top_attacker = sorted_attackers[0]
            execution_engine.attack(me, execution_engine.current_members[top_attacker])
